/*

   LINE HEIGHT / LEADING
   Docs: http://tachyons.io/docs/typography/line-height

   Media Query Extensions:
     -ns = not-small
     -m  = medium
     -l  = large

*/

  .lh-solid { line-height: var(--line-height-solid); }
  .lh-title { line-height: var(--line-height-title); }
  .lh-copy  { line-height: var(--line-height-copy); }

@media (--breakpoint-not-small) {
  .lh-solid-ns { line-height: var(--line-height-solid); }
  .lh-title-ns { line-height: var(--line-height-title); }
  .lh-copy-ns  { line-height: var(--line-height-copy); }
}

@media (--breakpoint-medium) {
  .lh-solid-m { line-height: var(--line-height-solid); }
  .lh-title-m { line-height: var(--line-height-title); }
  .lh-copy-m  { line-height: var(--line-height-copy); }
}

@media (--breakpoint-large) {
  .lh-solid-l { line-height: var(--line-height-solid); }
  .lh-title-l { line-height: var(--line-height-title); }
  .lh-copy-l  { line-height: var(--line-height-copy); }
}
